func BenchmarkPathDistanceFrom(b *testing.B) {
	basePath := testPath1()
	otherPath := testPath2()

	points := otherPath.Length()

	b.ReportAllocs()
	b.ResetTimer()
	for i := 0; i < b.N; i++ {
		basePath.DistanceFrom(otherPath.GetAt(i % points))
	}
}

